import React from 'react';
import logo from './logo.svg';
import NavBar from "./navBar";
import './App.css';

function MyButton() {
    const goToHomePage = () => {
        window.location.href('.'); /* name of the page */
    };
  return (
      <button onClick={goToHomePage} className= "button-class" />
  );
}

function App() {
  return (
    <div className="App">
        na
        <MyButton/>
    </div>
  );
}

export default App;
